    <BrowserRouter>
      <NavBar />
      <Routes>
        <Route path="/" element={<About />}></Route>
        <Route path="/contact" element={<Contact />}></Route>
        <Route path="/movies" element={<Movies />}></Route>    
      </Routes>

    </BrowserRouter>
  );
}

export default App;
